static unsigned int 
decodeHexDigit(char c)
{
    if (c >= '0' && c <= '9')
    {
        return (unsigned int) c - (unsigned int) '0';
    }
    else if (c >= 'a' && c <= 'f')
    {
        return 10 + (unsigned int) c - (unsigned int) 'a';
    }
    else if (c >= 'A' && c <= 'F')
    {
        return 10 + (unsigned int) c - (unsigned int) 'A';
    }
    else
    {
        return 0;
    }
}


DataChunk*
GetDefaultFontData()
{
    std::string decodedData;

    // Decode hex-encoded data into a string of bytes
    unsigned int stringCount = sizeof(DefaultFontData) / sizeof(DefaultFontData[0]);
    for (unsigned int i = 0; i < stringCount; ++i)
    {
        string chunk(DefaultFontData[i]);

        // Two hex digits per byte, so each chunk must have an even number of characters
        assert(chunk.length() % 2 == 0);

        for (unsigned int j = 0; j < chunk.length(); j += 2)
        {
            unsigned int byte = (decodeHexDigit(chunk[j]) << 4) | decodeHexDigit(chunk[j + 1]);
            decodedData += (char) byte;
        }
    }

    return new DataChunk(decodedData.data(), decodedData.length());
}
